  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Bison
  Range outlines Refuge accomplishments from May through August of 1944. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. The public
  relations section of the report describes recreational uses, Refuge visitors, and
  Refuge participation. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
